  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112170 includes profile,
  discrete sample and biological data collected aboard the LAURENCE M. GOULD during
  cruises LMG0104 and LMG0203 in the South Atlantic Ocean and South Pacific Ocean
  from 2001-05-01 to 2002-05-10. These data include ANIMALS - INDIVIDUAL - COUNTS,
  Displacement Volume, SPECIES IDENTIFICATION - LIFE STAGE, TAXONOMIC CODE and species
  abundance. The instruments used to collect these data include Multiple Opening/Closing
  Net and Environmental Sensing System (MOCNESS). These data were collected by Kendra
  Daly of University of South Florida as part of Southern Ocean GLOBEC. The Biological
  and Chemical Oceanography Data Management Office (BCO-DMO) submitted these data
  to NODC on 2013-07-31.nnThe following is the text of the abstract provided by BCO-DMO:nnZooplankton
  Abundance Based on Taxa and Life Stages or SizenCollected during the Process Cruises,
